import React from 'react'

export default function Form({ form, fields, button }) {
    // console.log(form.fields);

    return (
        <div>
        <form>
            <h4>{form.title}</h4>
            {fields.map((i) => <label>{i.label} <input name={i.name} type={i.type} group={i.group} required={i.required} /></label>)}
        </form>
        <button></button>
        </div>
    )
}
